import Station from "./Station";

class StationsManager
{
    constructor()
    {
        this.stations = [
            new Station("Wroclaw", 100, 50),
            new Station("Warszawa", 100, 450),
            new Station("Lodz", 200, 50),
            new Station("Katowice", 200, 450),
            new Station("Gdansk", 300, 50),
            new Station("Poznan", 300, 450)
        ];
    }
}

export default StationsManager;
